import Nav from './Nav';
import Link from "next/link";


export default function Header() {
    return (
        <div>
            <div className="bar">
                <h1>
                    <Link href="/">
                <a>Slick Fits</a>
                </Link>
                </h1>
                <Nav/>
            </div>

            <div className="sub-bar">
                <p >Search</p>
            </div>

            <div>Cart</div>

        </div>
    )
}
